import React, {useState, useEffect} from "react";
import "./Ranking.css";
import logo_js from "./js_logo_symbol.jpg"

function Ranking() {

    const [dbData, setDbData] = useState([]);

    useEffect(() => {
        fetch('/dbTest')
        .then((res) => res.json())
        .then((data) => setDbData(data.dbData));
    },[])

    return (
        <div>
            <h1>
                <label>Japan System</label>
                <br></br>
                <label>JS Token Ranking!</label>
            </h1>


            {/*JSON形式で受け取ったオブジェクトを表示させる方法*/}
	        <ul>{dbData.map((data) => (
                <li classname="li_next"  key={data.postUser} style={{listStyleType:"none"}} >
		            <span>{data.postUser}</span><span>{data.likeCount}</span>
	            </li>

                ))}
            </ul>

            <img src={logo_js} alt="logo_js" width="150px" />
        </div>
    );
}

export default Ranking;
